import { Morph, Icon, HTMLMorph } from "lively.morphic";
import { Color, pt } from "lively.graphics/index.js";
import { connect, disconnect } from "lively.bindings/index.js";
import { resource } from "lively.resources/index.js";
import { loadObjectFromSnapshot } from "lively.morphic/partsbin.js";

export default class Part_dash_item_dash_for_dash_partsbin extends Morph {

  reset() {
    connect(this.get("remove-button"), 'fire', this, 'interactivelyRemovePart');
  }

  async showPart(partResource) {
    // partResource = resource(System.decanonicalize("lively.morphic/")).join("parts/star.json")
    // partResource = resource(System.decanonicalize("lively.morphic/")).join("parts/button.json")
    // await this.showPart()
    var partName = partResource.name().replace(/\.json$/, "");
    var snapshot = JSON.parse(await partResource.read());
    this.state = {partName, partResource, snapshot};
    this.addPreviewMorph();
  }

  addPreviewMorph() {
    var {partName, snapshot} = this.state;

    var margin = 10,
        previewWidth = 100+2*margin,
        previewHeight = 100+2*margin,
        {x: w, y: h} = this.extent,
        borderWidth = 1,
        previewHTML = `<div style="width: 100%;">`
                    + `<div style="position: absolute; top: ${margin}px;`
                    + `            left: ${margin + (w-previewWidth) / 2}px">`
                    + snapshot.preview
                    + `</div>`
                    + `<div style="background-color: rgba(255,255,255, 0.8); `
                    + `            font-family: Arial; position: absolute; `
                    + `            left: ${borderWidth}px;`
                    + `            width: ${w - 2*borderWidth}px;`
                    + `            bottom: 3px"><center>${partName}</center></div>`
                    + `</div>`,
      previewSpec = {
        name: "html-preview",
        fill: null,
        reactsToPointer: false,
        html: previewHTML,
        extent: pt(w, h),
        // border: {width: 1, color: Color.gray, radius: 5},
        nativeCursor: "-webkit-grab"
      };

    var preview = this.getSubmorphNamed("html-preview") || this.addMorph(new HTMLMorph());
    Object.assign(preview, previewSpec);

    preview.domNode.style.pointerEvents = "none";
    // disconnect(preview, 'onDragStart', this, 'createAndGrabNewInstance',
    //   {converter: function() { return this.sourceObj; }});
    return preview;
  }

  onDragStart(evt) {
    this.createAndGrabNewInstance();
  }

  async createAndGrabNewInstance() {
    // FIXME
    var hand = this.world().firstHand;
    this.draggable = false;
    this.env.eventDispatcher.eventState.draggedMorph = null;
    try {
      var {snapshot} = this.state;
      var newMorph = await loadObjectFromSnapshot(snapshot)
      hand.grab(newMorph);
      newMorph.position = pt(0,0);
    } catch (e) {
      this.showError(e)
    } finally {
      this.draggable = true;
    }
  }

  async interactivelyRemovePart() {
    var {partName, partResource} = this.state;
    var really = await this.world().confirm(`Do you really want to remove part ${partName}?`);
    if (!really) return;
    await partResource.remove();
    if (this.owner.isPartsBin) { this.remove(); }
  }
}
